import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h2>
          Welcome to </h2><h1>Trish the Teacher !
        </h1>
        <div style={{ height: '200px',display: 'flex', justifyContent: 'center'}}className="teach"></div>
        <img src={logo} className="App-logo" alt="logo" />

        <p>Website currently under construction </p>
      </header>
    </div>
  );
}

export default App;
